--[[
math.randomseed(os.time())

local function getRandomObject(array)
	local randomIndex = math.random(1, #array)
	return array[randomIndex]
end

local LOGOS = {
	{ filename = "man.txt", height = 40, width = 100, animate = true },
}

local DIRPATH = "~/.config/nvim/lua/aib/plugins/"
return {
	"goolord/alpha-nvim",
	config = function()
		local alpha = require("alpha")
		local dashboard = require("alpha.themes.dashboard")
		require("alpha.term")

		-- Define a custom highlight group for the terminal section

		dashboard.opts.opts.noautocmd = true
		dashboard.section.terminal.opts.redraw = true

		local logo = getRandomObject(LOGOS)

		local command
		if logo.animate then
			command = "sh " .. DIRPATH .. "show.sh " .. DIRPATH .. "/" .. logo.filename
		else
			command = "cat " .. DIRPATH .. "/" .. logo.filename
		end

		dashboard.section.terminal.command = command
		dashboard.section.terminal.width = logo.width
		dashboard.section.terminal.height = logo.height
		dashboard.section.terminal.opts = {
			position = "center",
			hl = "LogoSection", -- Apply the custom highlight group
		}

		dashboard.opts.layout = {
			{ type = "padding", val = 3 },
			dashboard.section.terminal,
			{ type = "padding", val = 3 },
			{
				type = "text",
				val = "@jonlinkens",
				opts = {
					position = "center",
					hl = "Number",
				},
			},
			{ type = "padding", val = 3 },
			dashboard.section.buttons,
			dashboard.section.footer,
		}
		alpha.setup(dashboard.config)
	end,
}
--]]
